contract metamask {
    event Transfer(address _from, address _to, uint amount);

    receive() external payable {

    }

    function sendEther() public payable {
        payable(address(this)).transfer(msg.value);
        emit Transfer(msg.sender, address(this), msg.value);
    }
}

